import React from 'react';
import "./NumberList"
function NumberList(props) {
    console.log(props)
    const calculationList = props.calcList;
    console.log({calculationList})
    const listItems = calculationList.map((number) =>
      <li>{number}</li>
    );
    return (
      <ul>{listItems}</ul>
    );
  }

export default NumberList;
